import React from 'react';
import ReactDOM from 'react-dom';
import Main from './context/main';

/**
 * 
 * @import_routes
 * 
 */

import App from './routes/index'


ReactDOM.render(
    <Main>
      <App />
    </Main>,
  document.getElementById('root')
);
